import React from 'react';

const ShareSetupSection = () => {
  // Function to generate random width and height for the images
  const generateRandomSize = () => {
    const minWidth = 150;
    const maxWidth = 300;
    const minHeight = 150;
    const maxHeight = 300;

    const width = Math.floor(Math.random() * (maxWidth - minWidth + 1)) + minWidth;
    const height = Math.floor(Math.random() * (maxHeight - minHeight + 1)) + minHeight;

    return { width, height };
  };

  // Function to generate a random number of images (between 6 and 12)
  const generateRandomImages = () => {
    const numImages = Math.floor(Math.random() * 7) + 6; // Random number between 6 and 12
    const images = [];

    for (let i = 0; i < numImages; i++) {
      const { width, height } = generateRandomSize();
      images.push({ src: `/random-image-${i + 1}.jpg`, width, height });
    }

    return images;
  };

  // Generate random images
  const images = generateRandomImages();

  return (
    <div>
      <h2>Share your setup with #FuniroFurniture</h2>
      <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fill, minmax(150px, 1fr))', gridGap: '10px' }}>
        {images.map((image, index) => (
          <img
            key={index}
            src={image.src}
            alt={`Random Image ${index + 1}`}
            style={{ width: `${image.width}px`, height: `${image.height}px`, objectFit: 'cover' }}
          />
        ))}
      </div>
    </div>
  );
};

export default ShareSetupSection;
